import{_ as i,o as t,c as e,f as l}from"./app-66b3a2f7.js";const a={},h=l('<h1 id="git-管理远程仓库-github" tabindex="-1"><a class="header-anchor" href="#git-管理远程仓库-github" aria-hidden="true">#</a> Git 管理远程仓库 GitHub</h1><p>目的：借助 github 托管代码，备份，实现代码共享集中化管理。</p><h2 id="注册-github-账号" tabindex="-1"><a class="header-anchor" href="#注册-github-账号" aria-hidden="true">#</a> 注册 github 账号</h2><p>官网：github.com</p><h2 id="github-基本概念" tabindex="-1"><a class="header-anchor" href="#github-基本概念" aria-hidden="true">#</a> Github 基本概念</h2><ol><li>仓库(Repository)：仓库用来存放项目代码，每个项目对应一个仓库，多个开源项目则有多个仓库。</li><li>收藏(Star)：收藏项目，方便下次查看。</li><li>复制克隆项目(Fork)：复制克隆他人项目，可以添加修改代码，但只会影响自身的仓库。 注意：<strong>Fork 的项目是独立存在的。</strong></li><li>发起请求(Pull Request)：Fork 他人项目后，自己添加修改代码，发起请求，项目作者可以选择同意或拒绝请求。</li><li>关注(Watch)：关注项目后，可以收到该项目更新的通知消息。</li><li>创建项目：一个 git 库对应一个开源项目，通过 git 管理 git 库。新建或者导入文件。</li><li>修改项目：直接在项目上修改或者本地修改再上传到仓库。</li><li>删除项目：设置(setting)往下翻到最下面可以找到删除仓库(repository)。</li><li>搜索文件：点击 go to file 或者按快捷键 T。</li><li>事务卡片(Issue)：发现代码 BUG 或各种问题，需讨论时使用。</li><li>可以点击 Issue 来给别人提出问题或建议，别人或自己可以选择关闭或者回答。可以通过新建 Issue 和 Pull Request 为开源项目做贡献。</li></ol><h2 id="github-的三个页面" tabindex="-1"><a class="header-anchor" href="#github-的三个页面" aria-hidden="true">#</a> github 的三个页面</h2><ol><li>github 主页</li><li>仓库主页</li><li>个人主页</li></ol><h2 id="github-pages-搭建" tabindex="-1"><a class="header-anchor" href="#github-pages-搭建" aria-hidden="true">#</a> GitHub pages 搭建</h2><p>首先你需要注册一个 GitHub 账号，并在个人主界面里选择创建一个新的 Repository 。</p><ol><li>进入项目主页，点击 setting</li><li>在 setting 页面中找到 Github pages 下面的选择主题(choose a theme)</li><li>Source 下拉框选择 main,最后会得到一个网址</li><li>生成网页</li><li>访问<code>https://用户名.github.io</code></li></ol>',11),r=[h];function o(s,u){return t(),e("div",null,r)}const d=i(a,[["render",o],["__file","03_git_github.html.vue"]]);export{d as default};
